css:
.markdown-spinner {
  margin: auto;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px;
  background-position: top center;
  padding-top: 70px;
  text-align: center;
}
.show-todo-preview {
  font-family: 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 14px;
  line-height: 1.6;
  background-color: #f4f4f4;
  color: #444444;
  overflow: scroll;
  box-sizing: border-box;
  padding: 20px;
}
.show-todo-preview :not(.editor-colors) > code {
  color: #333;
}
.show-todo-preview .file_url {
  font-size: 10px;
  width: 100px !important;
}
.show-todo-preview .result_table {
  width: 100%;
}
.show-todo-preview .result_heading_title {
  border-bottom: 1px solid #999999;
}
.show-todo-preview .result_heading_title .regex {
  color: #999999;
  font-size: 14px;
}
.show-todo-preview a {
  color: #5293d8;
}
.show-todo-preview a.absent {
  color: #cc0000;
}
.show-todo-preview a.anchor {
  display: block;
  padding-left: 30px;
  margin-left: -30px;
  cursor: pointer;
  position: absolute;
  top: 0;
  left: 0;
  bottom: 0;
}
.show-todo-preview h1,
.show-todo-preview h2,
.show-todo-preview h3,
.show-todo-preview h4,
.show-todo-preview h5,
.show-todo-preview h6 {
  font-family: 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  margin: 20px 0 10px;
  padding: 0 0 10px 0;
  font-weight: bold;
  -webkit-font-smoothing: antialiased;
  cursor: text;
  position: relative;
}
.show-todo-preview table th {
  font-weight: bold;
}
.show-todo-preview table th,
.show-todo-preview table td {
  font-size: 14px;
  padding: 6px 6px;
}
.show-todo-preview table tr {
  background-color: #f4f4f4;
}
.show-todo-preview table tr:nth-child(2n) {
  background-color: #f7f7f7;
}
